import { Loading } from "../backend_component/loading";
const Group_manage=({data,synchronize_update,synchronize})=>{

    if(synchronize===true){
        return(
            <Loading/>
        )
    }
    return(
        <div className="group">
            <div>
                <button onClick={()=>{synchronize_update(true)}}>儲存</button>
            </div>
            {
                data.map((item,index)=>{
                    return(
                        <div key={index}>
                            <input defaultValue={item}/>
                        </div>
                    )
                })
            }
            <div>
                <input defaultValue='新增'/>
            </div>



        </div>
    )

}
export default Group_manage;
